export const COLUMNS=[
    {
        Header:'#',
        accessor: (name, index) => index + 1,
    },
    {
        Header:'Currency',
        accessor: 'Currency', 
        Cell: ({ value }) => {
            return (
                value !== null ?
                <div className="flex items-center justify-start">
                    <p>{value}</p>
                </div> : "N/A"
                )
        }
    },{
        Header:'Date',
        accessor: 'Date'

    },{
        Header:'Open',
        accessor: 'Open'

    },{
        Header:'High',
        accessor: 'High'

    },{
        Header:'Low',
        accessor: 'Low'

    },{
        Header:'Close',
        accessor: 'Close'

    },{
        Header:'Volume',
        accessor: 'Volume'

    },{
        Header:'MarketCap',
        accessor: 'Market Cap',
        Cell: ({ value }) => {
            return value !== null ? `$${value.toLocaleString()}` : "N/A"
        },
    },

]
